import React, { useState, useEffect } from 'react';

const Dashboard = () => {
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);

  // Mock user data (since we're not connecting to backend)
  useEffect(() => {
    const mockUsers = [
      { id: 1, username: 'admin', role: 'Administrator', lastLogin: '2023-10-15' },
      { id: 2, username: 'johndoe', role: 'User', lastLogin: '2023-10-14' },
      { id: 3, username: 'janedoe', role: 'User', lastLogin: '2023-10-13' },
      { id: 4, username: 'manager1', role: 'Manager', lastLogin: '2023-10-12' },
      { id: 5, username: 'support1', role: 'Support', lastLogin: '2023-10-11' }
    ];
    
    // Simulate API call delay
    setTimeout(() => {
      setUsers(mockUsers);
      setLoading(false);
    }, 800);
  }, []);

  return (
    <div className="dashboard-container">
      <h1>User Management Dashboard</h1>
      <div className="dashboard-stats">
        <div className="stat-card">
          <h3>Total Users</h3>
          <p>{users.length}</p>
        </div>
        <div className="stat-card">
          <h3>Admins</h3>
          <p>{users.filter(user => user.role === 'Administrator').length}</p>
        </div>
        <div className="stat-card">
          <h3>Regular Users</h3>
          <p>{users.filter(user => user.role === 'User').length}</p>
        </div>
      </div>
      
      <div className="user-list-section">
        <h2>User List</h2>
        {loading ? (
          <p>Loading users...</p>
        ) : (
          <table className="user-table">
            <thead>
              <tr>
                <th>ID</th>
                <th>Username</th>
                <th>Role</th>
                <th>Last Login</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {users.map(user => (
                <tr key={user.id}>
                  <td>{user.id}</td>
                  <td>{user.username}</td>
                  <td>{user.role}</td>
                  <td>{user.lastLogin}</td>
                  <td>
                    <button className="edit-btn">Edit</button>
                    <button className="delete-btn">Delete</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
